import { Button, Form } from "react-bootstrap";
import React, { useRef } from "react";
import { getLogestechsArea/* , recordRechargeBalance */ } from "../APIs/OrdersAPIs";


export default function TestComponent() {

    const strRef = useRef();

    const getLogestechsAreaHandler = () => {

        const str = strRef.current.value;

        if (str) {
            getLogestechsArea(str).then((res) => {
                console.log(res.data);
            })
        }
    }

    /* const recharge = () => {
        recordRechargeBalance().then(res => console.log(res.data));
    } */

    return (
        <>
            <Form.Control ref={strRef} placeholder="Area name..." />
            <Button onClick={getLogestechsAreaHandler}>
                Get Area
            </Button>

            <br />

            {/* <Button onClick={recharge}>Recharge Balance Test</Button> */}
        </>
    )
}
